(706, 162, 'intro_text', 'According to the Bhagavad Gita, all beings in the universe have both the divine qualities and the demonic qualities within each. <br>\r\nThe sixteenth chapter of the Bhagavad Gita states that pure god-like saints are rare and pure demon-like evil are rare among human beings, and the bulk of humanity is multi-charactered with a few or many faults. And after having an association or bonding with our patron we felt the same intensity of power and passion in them while executing the project of various scale. To understand and transfer that energy into a reality though design, I think that is our role at Jagya Designs.'),
